import React from "react";
import { Container, Row, Col, Nav, NavItem, NavLink } from "react-bootstrap";

const FooterNavigation = () => {
  const sections = [
    {
      title: "Our Product",
      links: ["Career", "Car", "Packages", "Features", "Priceline"],
    },
    {
      title: "About Rentcars",
      links: [
        "Why choose us",
        "Our Story",
        "Investor Relations",
        "Press Center",
        "Advertise",
      ],
    },
    {
      title: "Follow Us",
      social: true,
      icons: [
        {
          src: "https://dashboard.codeparrot.ai/api/image/Z7kIGVCHtJJZ6v_q/vuesax-l.png",
          alt: "Facebook",
        },
        {
          src: "https://dashboard.codeparrot.ai/api/image/Z7kIGVCHtJJZ6v_q/vuesax-l-2.png",
          alt: "Instagram",
        },
        {
          src: "https://dashboard.codeparrot.ai/api/image/Z7kIGVCHtJJZ6v_q/vuesax-l-3.png",
          alt: "Youtube",
        },
      ],
    },
  ];

  return (
    <Container
      fluid
      className="text-white"
      style={{ backgroundColor: "#051c34", padding: "20px"}}
    >
      <Row className="justify-content-between">
      <Col>
          <Row className="align-items-center mb-4">
            <Col xs="auto">
              <img
                src="https://dashboard.codeparrot.ai/api/image/Z7kIGVCHtJJZ6v_q/frame.png"
                alt="Rentcars Logo"
                className="img-fluid"
                style={{ width: "24px", height: "25.72px" }}
              />
            </Col>
            <Col>
              <span
                style={{
                  fontFamily: "Poppins",
                  fontSize: "16px",
                  fontWeight: 600,
                  lineHeight: "150%",
                }}
              >
                RENTCARS
              </span>
            </Col>
          </Row>

          {/* Contact Information Section */}
          <Row className="mb-3">
            <Col xs="auto">
              <img
                src="https://dashboard.codeparrot.ai/api/image/Z7kIGVCHtJJZ6v_q/vuesax-l-4.png"
                alt="Location Icon"
                style={{ width: "24px", height: "24px" }}
              />
            </Col>
            <Col>
              <span
                style={{
                  color: "#d6d6d6",
                  fontFamily: "Poppins",
                  fontSize: "14px",
                  fontWeight: 400,
                  lineHeight: "150%",
                }}
              >
                25566 Hc 1, Glenallen, Alaska, 99588, USA
              </span>
            </Col>
          </Row>

          <Row className="mb-3">
            <Col xs="auto">
              <img
                src="https://dashboard.codeparrot.ai/api/image/Z7kIGVCHtJJZ6v_q/vuesax-l-5.png"
                alt="Phone Icon"
                style={{ width: "24px", height: "24px" }}
              />
            </Col>
            <Col>
              <span
                style={{
                  color: "#d6d6d6",
                  fontFamily: "Poppins",
                  fontSize: "14px",
                  fontWeight: 400,
                  lineHeight: "150%",
                }}
              >
                (+359)-876-334-338
              </span>
            </Col>
          </Row>

          <Row>
            <Col xs="auto">
              <img
                src="https://dashboard.codeparrot.ai/api/image/Z7kIGVCHtJJZ6v_q/vuesax-l-6.png"
                alt="Email Icon"
                style={{ width: "24px", height: "24px" }}
              />
            </Col>
            <Col>
              <span
                style={{
                  color: "#d6d6d6",
                  fontFamily: "Poppins",
                  fontSize: "14px",
                  fontWeight: 400,
                  lineHeight: "150%",
                }}
              >
                rentcars@gmail.com
              </span>
            </Col>
          </Row>
        </Col>
        {sections.map((section, index) => (
          <Col key={index} xs={12} sm={6} md={3} className="m-4">
            <h5
              className="fw-medium"
              style={{
                fontSize: "16px",
                lineHeight: "150%",
                fontFamily: "Poppins",
              }}
            >
              {section.title}
            </h5>
            {section.social ? (
              <Nav className="d-flex flex-row gap-3">
                {section.icons.map((icon, idx) => (
                  <NavItem key={idx}>
                    <NavLink href="#" className="p-0">
                      <img
                        src={icon.src}
                        alt={icon.alt}
                        className="cursor-pointer"
                        style={{ width: "24px", height: "24px" }}
                        onMouseOver={(e) => (e.target.style.opacity = "0.8")}
                        onMouseOut={(e) => (e.target.style.opacity = "1")}
                      />
                    </NavLink>
                  </NavItem>
                ))}
              </Nav>
            ) : (
              <Nav className="flex-column">
                {section.links.map((link, idx) => (
                  <NavItem key={idx}>
                    <NavLink
                      href="#"
                      className="text-decoration-none"
                      style={{
                        color: "#d6d6d6",
                        fontSize: "14px",
                        lineHeight: "150%",
                        fontFamily: "Poppins",
                      }}
                      onMouseOver={(e) => (e.target.style.color = "#ffffff")}
                      onMouseOut={(e) => (e.target.style.color = "#d6d6d6")}
                    >
                      {link}
                    </NavLink>
                  </NavItem>
                ))}
              </Nav>
            )}
          </Col>
        ))}
      </Row>
    </Container>
  );
};

export default FooterNavigation;
